import "./News.css";
import { Container, Row, Col } from "react-bootstrap";
import NavBar from "../../components/Navbar/Navbar";

function News() {
  return (
    <>
      <NavBar />
      <Container
        fluid
        style={{ backgroundImage: `url("/images/bg-img.png")` }}
        className="cover"
      >
        <Row>
          <Col>
            <h1>
              Jaksa Agung Perintahkan Bentuk Tim Khusus Tangani Mafia
              Tanah-Pelabuhan
            </h1>
          </Col>
        </Row>
      </Container>
    </>
  );
}
export default News;
